#龙门架调平   
[quad_gantry_level]

gantry_corners:              # 300mm机器调平点位
	-60,-10
	360,370
points:
	50,25
	50,225
	250,225
	250,25
	

speed: 300                          # 调平速度
horizontal_move_z: 10               # Z轴起始高度
retries: 10                          # 超公差重试次数
retry_tolerance: 0.0050                # 采样公差
max_adjust: 15                      # 调平最大调整行程

#床网
[bed_mesh]
speed: 300 #100                          # 校准速度
horizontal_move_z: 10                # Z轴运动速度
mesh_min: 30, 30                    # 最小校准点坐标x，y
mesh_max: 270,270                   # 最大校准点坐标x，y
fade_start: 0.6                     # 开始逐步淘汰调整的Z高度。在开始淡入淡出过程之前，最好先减少几层
fade_end: 10.0                      # 可以根据打印表面的弯曲程度来调整此值
fade_target: 0                      # 可以被认为是附加的Ž偏移褪色完成之后施加到整个床的
probe_count: 100, 100               # 采样点数（5X5为25点）
algorithm: bicubic                  # 算法模型
zero_reference_position: 150, 150

####################################################################################
# IDM
####################################################################################
[mcu idm]
serial: /dev/serial/by-id/usb-IDM_614e_14000800104330344E333720-if00

[scanner]
mcu:idm
# mcu of IDM
speed: 40.
#   Z probing dive speed.
lift_speed: 5.
#   Z probing lift speed.
backlash_comp: 0.00656 #0.5
#   Backlash compensation distance for removing Z backlash before measuring
#   the sensor response.
x_offset: 0.
#   X offset of idm from the nozzle.
y_offset: 21.1
#   Y offset of idm from the nozzle.
trigger_distance: 2.
#   idm trigger distance for homing.
trigger_dive_threshold: 1.5
#   Threshold for range vs dive mode probing. Beyond `trigger_distance +
#   trigger_dive_threshold` a dive will be used.
trigger_hysteresis: 0.006
#   Hysteresis on trigger threshold for untriggering, as a percentage of the
#   trigger threshold.
cal_nozzle_z: 0.1
#   Expected nozzle offset after completing manual Z offset calibration.
cal_floor: 0.1
#   Minimum z bound on sensor response measurement.
cal_ceil: 5.
#   Maximum z bound on sensor response measurement.
cal_speed: 1.0
#   Speed while measuring response curve.
cal_move_speed: 10.
#   Speed while moving to position for response curve measurement.
default_model_name: default
#   Name of default idm model to load.
mesh_main_direction: x
#   Primary travel direction during mesh measurement.
#mesh_overscan: -1
#   Distance to use for direction changes at mesh line ends. Omit this setting
#   and a default will be calculated from line spacing and available travel.
mesh_cluster_size: 1
#   Radius of mesh grid point clusters.
mesh_runs: 1
#   Number of passes to make during mesh scan.
calibration_method: scan
#    校准方法的设置，如果你不想使用touch可以设置为scan来直接兼容旧版本的命令ng. 
sensor: idm
#   传感器名称，idm/cartographer
scanner_touch_max_temp:150
#    戳床时喷嘴下降到该温度
scanner_touch_z_offset: 0.05


tc_a_a:-2.9123096395447853e-06
tc_a_b:0.7562190336312722
tc_b_a:0.0006989543150719979
tc_b_b:-181.49256828828211

[lis2dw]
cs_pin: idm:PA3
spi_bus: spi1

[resonance_tester]
accel_chip: lis2dw
probe_points:
    150, 150, 20  #此处设置为你进行共振测量时喷头所处坐标
	

####################################################################################
# Pi及MCU温度监测
####################################################################################
[temperature_sensor IDM]
sensor_type: temperature_mcu
sensor_mcu: idm
min_temp: 0
max_temp: 105

[temperature_sensor ERCF]
sensor_type: temperature_mcu
sensor_mcu: mmu
min_temp: 0
max_temp: 60


[temperature_sensor Spider_Board]
sensor_type: temperature_mcu
sensor_mcu: mcu
min_temp: 0
max_temp: 60

[temperature_sensor Raspberry_Pi]
sensor_type: temperature_host
sensor_path:/sys/class/thermal/thermal_zone0/temp
min_temp: 0
max_temp: 80

####################################################################################
# 	舱内热敏
####################################################################################

[temperature_sensor Chamber]              # 箱内温度（需要增加一颗温感）
sensor_type: Generic 3950      #热敏电阻类型
sensor_pin: PC1
#sensor_pin: PB1 #T4                      # 修改对应PIN（必填）
min_temp: 0
max_temp: 60

[temperature_sensor Electronic]              # 箱内温度（需要增加一颗温感）
sensor_type: Generic 3950      #热敏电阻类型
sensor_pin: PC2                    # 修改对应PIN（必填）
min_temp: 0
max_temp: 60

